<div class="entities" style="line-height: 2.5; direction: ltr">Distribution of polyamines and their biosynthetic enzymes in intestinal adaptation . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ( ODC ) and the polyamines have been shown to be important for growth processes in the intestinal mucosa . The highest activity of ODC is found in the differentiated , nonproliferating villus-tip cells rather than in the rapidly proliferating undifferentiated crypt cells . During poststarvation refeeding and lactation , we now show that increases in ODC activity paralleled the time course of mucosal hyperplasia and thymidine incorporation . Increases in ODC ( threefold ) were similar in villus and crypt cells , and the villus-crypt gradient of decreasing ODC activity ( 40:1 ) was maintained . The activity of the other polyamine biosynthetic enzyme , S-adenosylmethionine decarboxylase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) , was highest in the crypt cells in the basal state and increased throughout the entire villus-crypt axis during refeeding and lactation , preserving a villus-crypt gradient opposite to that of ODC . During hyperplasia , all three polyamines increased .

 was highest in the villus-tip cells , paralleling ODC activity , whereas spermidine and spermine were highest in the crypt cells and paralleled the distribution of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 activity . Thus 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Separation of peptides from detergents using ion mobility spectrometry . Mass spectrometry ( MS ) has dramatically evolved in the last two decades and has been the driving force of the spectacular expansion of proteomics during this period . However , the very poor compatibility of MS with detergents is still a technical obstacle in some studies , in particular on membrane proteins . Indeed , the high hydrophobicity of membrane proteins necessitates the use of detergents for their extraction and solubilization . Here , we address the analytical potential of high-field asymmetric waveform ion mobility spectrometry ( FAIMS ) for separating peptides from detergents . The study was focused on peptides from the human integral membrane protein 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 . A tryptic peptide was mixed with the non-ionic detergents Triton X - 100 or beta-D-dodecyl maltoside ( DDM ) as well as with the ionic detergents sodium dodecyl sulfate ( SDS ) or sodium DB03619 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P18827
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Although electrospray ionization ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P19957
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) alone led to a total suppression of the peptide ion signal on mass spectra with only detection of the detergents , use of FAIMS allowed separation and clear identification of the peptide with any of the detergents studied . The detection and identification of the target compound in the presence of an excess of detergents are then feasible . FAIMS should prove especially useful in the structural and proteomic analysis of membrane proteins .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Behavioral and physiologic effects of genetic or pharmacologic inactivation of the DB05875 receptor ( NK1 ) . Depression and anxiety are among the most common diseases in the United States , thus constituting a substantial financial burden for the health care system . Experimental studies of these affective disorders to date have largely focused on the neurotransmitter pathways with well-established pathophysiologic roles , such as serotonergic , noradrenergic , and gamma-aminobutyric acid ( GABA ) - ergic systems ; agents modulating the activity of these pathways are known to be clinically effective . More recently , the neuropeptide DB05875 ( SP ) and its receptor ( the neurokinin - 1 receptor [

<h2 style="margin: 0">20</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Fc receptor blockade and immune thrombocytopenic purpura . Inhibition of antibody-coated platelet destruction in patients with immune thrombocytopenic purpura ( ITP ) is a well-known mechanism of treatment effect . A number of interventions that would ameliorate the thrombocytopenic effect of ITP patient plasma when infused into normal recipients were demonstrated in 1965 . Subsequently , the antibody-coated chromium-labeled red blood cell clearance study was developed to allow direct in vivo assessment of Fc receptor ( FcR ) blockade . This was first demonstrated for corticosteroids but more extensive investigation began with the study of intravenous infusions of gammaglobulin ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00028
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) . The unequivocal demonstration of FcR blockade following 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00028
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 Initiated novel approaches . One involved the infusion of a monoclonal anti-FcRIII ligand-blocking antibody into patients with refractory ITP . The efficacy of this treatment demonstrated that FcR blockade was not an epiphenomenon but rather an important mechanism of the increase in the platelet count in patients with ITP . Confirmation of its importance was obtained from the infusion of intravenous ( IV ) anti-D and the use of the isolated Fc piece of IgG . Recent studies have begun to explore the possibility of a monoclonal anti - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P12314
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and monoclonal anti-Ds . In summary , FcR blockade is an important mechanism of treatment effect in patients with ITP . Cytokine release as a consequence of this interaction and other immunomodulatory effects have only begun to be studied .</div>
